import React from "react";
import styled from "styled-components";

function Button({ children }) {
  return <ButtonWrapper>{children}</ButtonWrapper>;
}

const ButtonWrapper = styled.button`
  border: none;
  outline: none;
  border-radius: 32px;
  height: 32px;
  background: #fdc838;
  color: black;
  padding: 0 24px;
  cursor:pointer;
`;

export default Button;
